import Header from "./components/Header";
import Footer from "./components/Footer";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { CssBaseline } from "@material-ui/core";
import HomeScreen from "./screens/HomeScreen";
import ProductScreen from "./screens/ProductScreen";
import Places from "./components/Places";
import StatesOfIndia from "./components/StatesOfIndia";
import { Container, makeStyles, Typography } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    minHeight: "100vh",
    backgroundImage: `url(${process.env.PUBLIC_URL + "/assets/bg13.jpg"})`,
    backgroundRepeat: "no-repeat",
    backgroundSize: "cover",
  },
}));

const App = () => {
  const classes = useStyles();
  return (
    <Router>
      <div className={classes.root}>
        <CssBaseline />
        <Header />
        <Route path="/" component={HomeScreen} exact />
        <Route path="/states" component={StatesOfIndia} exact />
        <Route path="/states/:id/places" component={Places} exact />
        <Route path="/states/:id/places/:place_id" component={Places} exact />
      </div>
    </Router>
  );
};

export default App;
